USE publictransport;

-- Tạm thời tắt kiểm tra khóa ngoại để xóa bảng
SET FOREIGN_KEY_CHECKS = 0;

-- XÓA BẢNG NẾU TỒN TẠI (theo thứ tự phụ thuộc ngược)
DROP TABLE IF EXISTS Stop;
DROP TABLE IF EXISTS Station;
DROP TABLE IF EXISTS Location;
DROP TABLE IF EXISTS Coordinates;
DROP TABLE IF EXISTS Schedule_Trip;
DROP TABLE IF EXISTS Schedule_Day;
DROP TABLE IF EXISTS Schedule;
DROP TABLE IF EXISTS Route_Variant;
DROP TABLE IF EXISTS User_Route;
DROP TABLE IF EXISTS Route;
DROP TABLE IF EXISTS Type_Route;
DROP TABLE IF EXISTS Notification;
DROP TABLE IF EXISTS report;
DROP TABLE IF EXISTS Status_Report;
DROP TABLE IF EXISTS User;
DROP TABLE IF EXISTS Role;

-- Bật lại kiểm tra khóa ngoại
SET FOREIGN_KEY_CHECKS = 1;

-- === TẠO CÁC BẢNG ===

-- Role
CREATE TABLE Role (
                      name VARCHAR(20) PRIMARY KEY
);
INSERT INTO Role (name) VALUES ('ADMIN'), ('USER');

-- User
CREATE TABLE User (
                      id BIGINT PRIMARY KEY AUTO_INCREMENT,
                      firstname VARCHAR(255),
                      lastname VARCHAR(255),
                      email VARCHAR(255),
                      password VARCHAR(255),
                      role VARCHAR(20),
                      avatar VARCHAR(255),
                      CONSTRAINT uk_user_email UNIQUE (email),
                      FOREIGN KEY (role) REFERENCES Role(name)
);

-- StatusReport
CREATE TABLE Status_Report (
                               name VARCHAR(20) PRIMARY KEY
);
INSERT INTO Status_Report (name) VALUES ('PENDING'), ('VERIFIED');

-- Report
CREATE TABLE report (
                        id BIGINT PRIMARY KEY AUTO_INCREMENT,
                        latitude DOUBLE NOT NULL,
                        longitude DOUBLE NOT NULL,
                        description TEXT,
                        image VARCHAR(255),
                        status VARCHAR(20),
                        user_id BIGINT,
                        FOREIGN KEY (user_id) REFERENCES User(id) ON DELETE CASCADE,
                        FOREIGN KEY (status) REFERENCES Status_Report(name) ON DELETE CASCADE
);

-- Notification
CREATE TABLE notification (
                              id BIGINT PRIMARY KEY AUTO_INCREMENT,
                              time DATETIME NOT NULL,
                              message TEXT NOT NULL,
                              user_id BIGINT,
                              FOREIGN KEY (user_id) REFERENCES User(id) ON DELETE CASCADE
);

-- TypeRoute
CREATE TABLE Type_Route (
                            name VARCHAR(20) PRIMARY KEY
);
INSERT INTO Type_Route (name) VALUES ('BUS'), ('ELECTRIC_TRAIN');

-- Route
CREATE TABLE Route (
                       id BIGINT PRIMARY KEY AUTO_INCREMENT,
                       code VARCHAR(20),
                       name VARCHAR(100),
                       type VARCHAR(20),
                       FOREIGN KEY (type) REFERENCES Type_Route(name)
);

-- User_Route
CREATE TABLE User_Route (
                            user_id BIGINT,
                            route_id BIGINT,
                            PRIMARY KEY (user_id, route_id),
                            FOREIGN KEY (user_id) REFERENCES User(id),
                            FOREIGN KEY (route_id) REFERENCES Route(id)
);

-- RouteVariant
CREATE TABLE Route_Variant (
                               id BIGINT PRIMARY KEY AUTO_INCREMENT,
                               route_id BIGINT,
                               is_outbound BOOLEAN,
                               name VARCHAR(255),
                               distance FLOAT,
                               start_stop nvarchar(255),
                               end_stop nvarchar(255),
                               FOREIGN KEY (route_id) REFERENCES Route(id)
);
-- INSERT INTO routevariant (route_id, is_outbound, name, distance, start_stop, end_stop)
-- Schedule
CREATE TABLE Schedule (
                          id BIGINT PRIMARY KEY AUTO_INCREMENT,
                          route_variant_id BIGINT,
                          start_date DATETIME,
                          end_date DATETIME,
                          priority INT,
                          FOREIGN KEY (route_variant_id) REFERENCES Route_Variant(id)
);
-- INSERT INTO schedule (routevariant_id, start_date, end_date, priority)
-- Schedule_DayOfWeek
CREATE TABLE Schedule_Day (
                              schedule_id BIGINT,
                              day VARCHAR(10),
                              PRIMARY KEY (schedule_id, day),
                              FOREIGN KEY (schedule_id) REFERENCES Schedule(id)
);
-- INSERT INTO schedule_day (schedule_id, day)

-- ScheduleTrip
CREATE TABLE Schedule_Trip (
                               id BIGINT PRIMARY KEY AUTO_INCREMENT,
                               schedule_id BIGINT,
                               start_time TIME,
                               end_time TIME,
                               FOREIGN KEY (schedule_id) REFERENCES Schedule(id)
);
-- INSERT INTO scheduletrip (schedule_id, start_time, end_time) VALUES

-- Station
CREATE TABLE Station (
                         id BIGINT PRIMARY KEY AUTO_INCREMENT,
                         name VARCHAR(255),
                         lat DOUBLE,
                         lng DOUBLE,
                         address VARCHAR(255),
                         street VARCHAR(100),
                         ward VARCHAR(100),
                         zone VARCHAR(100)
);

-- Stop
CREATE TABLE Stop (
                      id BIGINT PRIMARY KEY AUTO_INCREMENT,
                      route_variant_id BIGINT,
                      station_id BIGINT,
                      stop_order INT,
                      FOREIGN KEY (station_id) REFERENCES Station(id),
                      FOREIGN KEY (route_variant_id) REFERENCES Route_Variant(id)
);
